import styled from 'styled-components';
import './font.css';

const Container = styled("div")`
width: 100%;
box-sizing: border-box;
margin:auto;
margin-top:100px;
padding: 20px;
border-bottom-left-radius: 5px;
border-bottom-right-radius: 5px;
display: flex;
flex-direction: column;
justify-content: center;
align-items: center;
color:black;
`
const Wsfont = styled("p")`
    color: Pink; 
    font-family: "Courier";
    font-size: 20px;
    margin: 10px 0 0 10px;
    white-space: nowrap;
    overflow: hidden;
    width: 30em;
    animation: type 4s steps(60, end); 
`


const Wfont =() =>{
    return (
        <Container>
        <Wsfont>Hi folks, this is typing animation using CSS</Wsfont>
        </Container>
        )
};
export default Wfont;
